    function dropdown () {
        $(".dropdown-content").hide();
        $(".dropdown-content li").click(function () {
            const svgElements = $('.hover-region-svg'); 
            var regionName = $(this).data("regionname");
            var regionHref = $(this).data("regionhref");
            $('.dropdown-content').removeClass('active');
            $(".red-Button-link").text(regionName);
            $(".red-Button-link").attr("href", regionHref);
            $(".red-Button-link").show();
            svgElements.removeClass("hovered")
            svgElements.filter(`[data-region="${regionName}"]`).addClass("hovered");
        });
        $(".dropdown").click(function(){
            $('.dropdown-content').toggle()
            if($('.dropdown-content').hasClass('active')){
                $('.dropdown-content').removeClass('active');
            }else{
                $('.dropdown-content').addClass('active');
            }
        })
    }
   const showOnlyRelatedClub = (paramURL) => {
        $('.w-dyn-item').hide()
        $('.club-item').each(function (){
            if($(this).attr('region') === paramURL){
                $(this).parents('.w-dyn-item').show()
            }
        })
    }
    const filterOnregionSinglePage = (paramURL) =>{
        $('.search-input').on('keyup', function() {
            const query = $(this).val().toLowerCase();
            if (query.length >= 1) {
                $('.club-item').each(function() {
                    const $item = $(this);
                    const region = $item.attr('region');
                    const data = {
                        clubaddresszip: $item.attr('clubaddresszip'),
                        clubname: $item.attr('clubname'),
                        clubaddresscity: $item.attr('clubaddresscity'),
                        region: $item.attr('region'),
                        sports: $item.attr('sports')
                    };

                    if (region === paramURL) {
                        const sportsArray = data.sports.toLowerCase().split(', ');
                        const matched = sportsArray.some(word => word.includes(query));
                        if (
                            data.clubaddresszip.toLowerCase().startsWith(query) ||
                            data.clubname.toLowerCase().startsWith(query) ||
                            data.clubaddresscity.toLowerCase().startsWith(query) ||
                            data.region.toLowerCase().startsWith(query) ||
                            matched
                        ) {
                            $item.show();
                        } else {
                            $item.hide();
                        }
                    } else {
                        $item.hide();
                    }
                });
            } else {
                $('.club-item').show(); // Show all items when the search input is empty
            }
        });
    }
